const GameKeyboard = () => {


    return (
        <div>
            <div className="keyboardButton"
                    onCLick={() =>{alert("Q")}}
            >Q</div>
            <div className="keyboardButton">W</div>
            <div className="keyboardButton">E</div>
            <div className="keyboardButton">R</div>
            <div className="keyboardButton">T</div>
            <div className="keyboardButton">Y</div>

        </div>
    )
}

export default GameKeyboard
